import InputNumber from './InputNumber';
import InputText from './InputText';
import InputTextArea from './InputTextArea';

class Form extends React.Component {
  render() {
    return (
      <main>
        <InputText data-testid="name-input" />
        <InputTextArea data-testid="description-input" />
        <InputNumber data-testid="attr1-input" />
      </main>
    );
  }
}

export default Form;
